import React, { Fragment } from 'react';

import styled from 'styled-components';
import DataForm from '../../styled/DataForm';
import DataField from '../../styled/DataField';
import SendForm from '../../styled/SendForm';

const Title = styled.h3`
	letter-spacing: 1.25px;
	margin-bottom: 0.75em;
`;

const StyledSubmit = styled(SendForm)`
	display: inline-block;
	margin: 1.25em 0 0.75em 0;
`;

const Register = () => {
	return (
		<Fragment>
			<DataForm onSubmit={(e) => onSubmit(e)}>
				<Title>Register</Title>
				<DataField>
					<label htmlFor='full-name'>fullname</label>
					<input type='text' id='full-name' />
				</DataField>
				<DataField>
					<label htmlFor='email'>email </label>
					<input type='email' name='email' />
				</DataField>
				<DataField>
					<label htmlFor='Password'>password </label>
					<input type='password' name='Password' />
				</DataField>

				<SendForm>Submit</SendForm>
			</DataForm>
		</Fragment>
	);
};

export default Register;
